(1080, 'Medical Certificate', 'This is to certify that SANGITA VIVEK THAKAR,53 yrs/female, had Acute Coronary Syndrome underwent coronary angiography, shows Recannalised RCA and moderate disease in LAD.\nShe is under my treatment for the same. She is advised to avoid physical , mental exertion and also require close medical attention.\nShe needs rest from 3 Dec 2019 to 5 Dec 2019.', '2019-12-03 13:54:31');
