('Moderate AS', '34', '28', '13', '50', '13', '39', '60', 'Normal', 'Mild concentric LV hypertrophy \nPreserved LV systolic function.\nLVEF =60%\nNo RWMA.\n', '', 'Mitral valve Normal,\nTricuspid valve regurgitation gradient is 25 mmHg.\nEstimated PA pressure is 35 mm|Hg \nmild Pulmonary hypertension.\n', 'Thickened and calcified aortic valve.\nModerate aortic stenosis. Mild AR.\nAV peak Gradient is 61mmHg, Mean Gradient = 34 mmHg.\n', '', 'No Pericardial effusion,thrombus,Vegetation\nIVC not dialated and shows near total collapse. \nNormal RA Pressure.\n', 'Moderate  Aortic Stenosis. \nMild AR\nPreserved LV systolic function.\nLVEF =60% \nNo RWMA.\nMild  Pulmonary Hypertension.\nNormal RA pressure.'),
('MS with Normal LV', '40', '30', '08', '40', '09', '23', '65', 'Normal', 'Mildly Dilated LA , LV. \nNormal LV systolic function.  LVEF =65%\nNo RWMA.', '', 'Mitral valve thickened and calcified. Shows doming,\nModerate Mitral Stenosis. MVA = 1.5  sqCm.(PHT) 1.4sqcm (plani) \nMV peak Gradient is 16mmHg, Mean Gradient = 6.5 mmHg.\nTricuspid valve regurgitation gradient is 25 mmHg.\nEstimated PA pressure is 35 mm|Hg \nNormal Pulmonary Artery pressure.\n', 'Mild aortic regurgitation. Gr I to II. Vena contracta = 3mm', '', 'No Pericardial effusion, thrombus, Vegetation\nIVC not dialated and shows near total collapse. \nNormal RA Pressure.\n', 'Moderate Mitral Stenosis. MVA = 1.5  sqCm.(PHT)						Normal biventricular function.\nNormal Pulmonary Artery pressure.\nNormal RA pressure.'),
('MVP', '32', '28', '09', '44', '10', '25', '70', 'Normal', 'Normal LV dimension\nNormal LV systolic function.  LVEF = 70%\nNo RWMA.\nNormal diastolic function.\n', 'Normal in size and function.\nLeft atrium and right atrium is normal.\n', 'Myxomatous mitral valve. Mild AML prolapse. No MR\nAcceptable gradients across Mitral valves and Tricuspid Valves.\nTricuspid valve regurgitation gradient is normal.\nEstimated PA pressure is normal.\n', 'Acceptable gradients across Aortic Valve and pulmonary valves.', 'Intact', 'No Pericardial effusion, thrombus, Vegetation\nIVC not dialated and shows near total collapse. \nNormal RA Pressure.\n', 'Myxomatous mitral valve. Mild AML prolapse. No MR\nNormal LV dimension and  function. LVEF = 70%\nNo RWMA.\nNormal PA & RA pressure.'),
('Prosthetic Mitral Valve', '38', '29', '14', '44', '09', '30', '60', 'Normal', 'Dilated LA , Normal sized LV. \nNormal LV systolic function.  LVEF =60%\nNo RWMA.\n', '', 'Prosthetic mitral valve in situ. No para or peri valvular leak\nAcceptable gradients across mitral prosthesis.\nMV peak Gradient is 12mmHg, Mean Gradient = 4.1 mmHg.\nTricuspid valve regurgitation gradient is 32mmHg.\nEstimated PA pressure is 45 mm|Hg \nMild  Pulmonary hypertension.\n', 'Acceptable gradients across Aortic Valve and pulmonary valves.', '', 'No Pericardial effusion, thrombus, Vegetation\nIVC not dialated and shows near total collapse. \nNormal RA Pressure.\n', 'Prosthetic mitral valve in situ. No para or peri valvular leak\nAcceptable gradients across mitral prosthesis.\nMild Pulmonary hypertension.\nNormal LV systolic function.'),
('Sclerotic Aortic valve', '31', '28', '13', '44', '14', '30', '60', 'Normal', 'Mild concentric LVH \nNormal LV systolic function.  LVEF =60%\nNo RWMA.\nNormal diastolic function.\n', '', 'Mitral valve normal structure,\nAcceptable gradients across Mitral valves and Tricuspid Valves.\nTricuspid valve regurgitation gradient is normal.\nEstimated PA pressure is Normal.\n', 'Sclerotic Aortic Valve. No Aortic stenosis. AVPG = 16 mmHg', '', 'No Pericardial effusion, thrombus, Vegetation\nIVC not dilated and shows near total collapse. \nNormal RA Pressure.\n', 'Mild concentric LVH \nNormal LV systolic function.  LVEF =60%\nNo RWMA. Sclerotic Aortic Valve. \nNormal diastolic function.'),
('Septoapical Hypokinesia', '32', '28', '10', '48', '10', '37', '45', 'Normal', 'LV mildly dilated\nSeptoapical hypokinesia.\nMild LV systolic dysfunction. LVEF = 45%\n', 'Normal in size and function.', 'Mitral valve normal structure,\nAcceptable gradients across Mitral valves and Tricuspid Valves.\nTricuspid valve regurgitation gradient is normal.\nEstimated PA pressure is Normal. \n', 'Acceptable gradients across Aortic Valve and pulmonary valves.\nSclerosed AV', 'Intact', 'Thin Nontappable rim of pericardial effusion. \nNo thrombus or Vegetation\nIVC is Normal.\n', 'LV mildly dilated\nSeptoapical hypokinesia.\nMild LV systolic dysfunction. LVEF = 45%');
INSERT INTO `exercise_photo_master` (`title`, `details`) VALUES
('ABDOMINAL ISOMETRIC CONTRACTIONS', '1. Lie flat on your back with knees bent.\n2. Pull the belly button up and press your waist down.\n3. Hold for 10 seconds.'),
('ABDOMINAL STRENGTHENING EXS', '1)	Lie on the back, face up, with knee bent\n2)	Hands behind the neck \n3)	Do not push against the head or neck with hands\nRaise your upper body up\n\n'),
('BICEP CURLS', '1)	This exercise can be completed an a bench or using a physio ball\n2)	Position the feet slightly wider than the hips and keep feet firmly on the floor\n3)	Curl both dumbbells up to the shoulders simultaneously\n'),
('BRIDGES', '1) Lie on your back on the floor with your knees bent     \n2) Lift your pelvis up –hold for 10 seconds.\n'),
('CAT AND THE COW', '1)	Begin with your hands and knees on the floor\n2)	On the exhale, round your spine up towards the ceilings, pull up the belly button up towards your spine\n3)	On your inhale, each your  back, let your belly relax\n'),
('CORE STRENGHTHENING EXERCISE', '1)	straight Starting position on all four\n2)	Raise opposite hand and leg keeping your back \nEngage your core all the time.\n'),
('DRAW THE SWORD', '1. Start with your arm across your body next to the opposite hip/pocket.\n2. Keeping the elbow fixed, pull the arm up and across the body slowly, externally rotating the arm.\n3. return to the starting position.'),
('DUMBELL SQUAT', '1)	Stand up straight while holding a dumbbell.\n2)	Position your legs using a shoulder width stance with toes pointed out.\n3)	Keep your head up at all times a looking down will get your off balance and also maintain a straight back.\n'),
('LUNGE', '1) Keep your upper body straight with shoulder and back relaxed and chin up. Always engage your core.\n2) Step forwards with one leg, lowering your hips until both knees are bent at about a 90 degree angle.\n3) Make sure your front knee is directly above the ankle.\n4) Keep the weight in your heels as you push back up to the starting posture.\n'),
('PLANKS', '1)	Position your elbows directly beneath your shoulder\n2)	Make and maintain a straight body line from head to heel\n3)	Squeeze your buttucks and the fronts of your thighs.\n4)	Hold 15 secs gradually progress as per your exercise therapist \n'),
('REVERSE LUNGE', '1)	Stand tall with feet together    \n2)	Large backwards by dropping one leg back so that the front leg is parallel to the floor with the knee bent at 90 degree.\n3)	The back leg should be bent at the knee as well.\n4)	Using the forward leg, pull your body back to the starting position.\n5)	Progress by returning to a single leg balance posture.\n'),
('SIDE PLANK', ''),
('SQUATS', ''),
('STANDING HAMSTRTRING STRETCH', '1)	place your foot in the front, maybe on a stool.\n2)	Try and touch your toes with your hand\n3)	Make sure both your knees stay straight\n4)	Hold for 10-15 secs\n5)	Repeat with the other leg. \n'),
('UPPER BODY STRENGTHENING', '1. Place a shortened band in hands with arms extended out in front of the body.\n2. Slowly retract the shoulder blades pulling the band apart untill the arms reach the sides of the body in a full range of motion.\n3. Return slowly to starting position.'),
('UPRIGHT ROW WITH BAND', '1. Assume a split stance with band grips in hand.\n2. Backup to an appropriate distance, retract shoulder blades pulling your hands towards your nose.\n3. return the band back to starting position.');
