INSERT INTO `patient_physical_medication` (`patientId`, `advice`, `visitDate`) VALUES
(1, 'This is physical medication', '2019-05-25'),
(1, 'This is physical medication advice to be given as physical fitness remarks and consultation', '2019-05-28'),
(8, '\n  ADV:\n     Stretching and strengthening exs to be incorporated.\n     Cycling on stationary bicycle..as a form of cardio work out\n     15 mins...no resistance(as tolerated)\n     Posture correction exs ..demonstrated.\n     RPE to be monitored as a scale of level of exertion.\n     (Borgs scale)', '2019-05-29'),
(21, 'Adv\nCardio and strength training exs\nCounselled for the Cardiac Reversal program', '2019-06-13'),
(34, 'All existing xs revised...corrected.\nAdvised doing all exs infront of the mirror for good visual feedback.\nAdditional exs advised as per follows..\n1.Tadasana\n2. scapular setting exs\n3.Gomukhasana\n4.Knee extension exs\n5.Back exs\n6.Leg raises..only 10 degrees...\n\nNotes\n1.look at your posture\n2.do not hold your breath while doing any of these\n3.10 reps..progressed to 15 each\n4.stop when discomfort\n5.warm up and cool down pahses 5 mins each', '2019-06-21'),
(59, 'Floor exs work out\n\n\nPlease consider following points vwhile exercising\n1.do not hold your breath during any exercises\n2.try to monitor your pulse at rest and at peak intensity workout\n3.do not skip warm up and cool down phases.\n\nWarm up...\n1.all upper body and lower body stretches\n2 10 MINS\nAerobic session\n1.spot jogs\n2.4 more high intensity activities\n3.sguats\n4.Lunges\n5.Reverse Lunges\n6.hip walk\nCool down\n1.4 abs work outs  10 reps 1 set....2 sets\n2.plank..hold for 30 secs......progress to 1 min\n3.back extension  10 reps ,1 set', '2019-06-29'),
(280, 'ADV,\n\ncervical and upper girdle exs\nFollow up after a week', '2019-09-09');
INSERT INTO `patient_prescribed_exercise` (`patientId`, `title`, `details`, `steps`, `doctorId`, `visitDate`) VALUES
(431, 'CAT AND THE COW', '1)	Begin with your hands and knees on the floor\n2)	On the exhale, round your spine up towards the ceilings, pull up the belly button up towards your spine\n3)	On your inhale, each your  back, let your belly relax\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'STANDING HAMSTRTRING STRETCH', '1)	place your foot in the front, maybe on a stool.\n2)	Try and touch your toes with your hand\n3)	Make sure both your knees stay straight\n4)	Hold for 10-15 secs\n5)	Repeat with the other leg. \n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'DUMBELL SQUAT', '1)	Stand up straight while holding a dumbbell.\n2)	Position your legs using a shoulder width stance with toes pointed out.\n3)	Keep your head up at all times a looking down will get your off balance and also maintain a straight back.\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'UPPER BODY STRENGTHENING', '1. Place a shortened band in hands with arms extended out in front of the body.\n2. Slowly retract the shoulder blades pulling the band apart untill the arms reach the sides of the body in a full range of motion.\n3. Return slowly to starting position.', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'LUNGE', '1) Keep your upper body straight with shoulder and back relaxed and chin up. Always engage your core.\n2) Step forwards with one leg, lowering your hips until both knees are bent at about a 90 degree angle.\n3) Make sure your front knee is directly above the ankle.\n4) Keep the weight in your heels as you push back up to the starting posture.\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'SQUATS', '', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'BRIDGES', '1) Lie on your back on the floor with your knees bent     \n2) Lift your pelvis up –hold for 10 seconds.\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'BICEP CURLS', '1)	This exercise can be completed an a bench or using a physio ball\n2)	Position the feet slightly wider than the hips and keep feet firmly on the floor\n3)	Curl both dumbbells up to the shoulders simultaneously\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'ABDOMINAL ISOMETRIC CONTRACTIONS', '1. Lie flat on your back with knees bent.\n2. Pull the belly button up and press your waist down.\n3. Hold for 10 seconds.', 'Repeat: \n\nSets:  ', 3, '2019-10-21'),
(431, 'ABDOMINAL STRENGTHENING EXS', '1)	Lie on the back, face up, with knee bent\n2)	Hands behind the neck \n3)	Do not push against the head or neck with hands\nRaise your upper body up\n\n', 'Repeat: \n\nSets:  ', 3, '2019-10-21');
